(145, 1, '2020-01-29 18:07:53', '2020-01-29 17:07:53', 'Jeśli mam ochotę zjeść coś ze znajomymi, zawsze wybieram Burgeromanię. Nie wiem jak oni to robią, ale podają najlepsze burgery w mieście w bardzo atrakcyjnej cenie. A kiedy nie chce mi się wychodzić z domu, po prostu zamawiam jedzenie na ich stronie.', 'Opinia 1', '', 'publish', 'closed', 'closed', '', 'opinia-1', '', '', '2020-01-29 18:07:53', '2020-01-29 17:07:53', '', 0, 'http://localhost/burgers_workon_project/?post_type=reviews&#038;p=145', 0, 'reviews', '', 0),
(146, 1, '2020-01-29 18:08:44', '2020-01-29 17:08:44', 'Próbowaliście kiedyś przekonać rodziców, że schabowy z ziemniakami to nie jedyna opcja na niedzielny obiad? Ja tak. Oczywiście bezskutecznie... dopóki nie zabrałem staruszków do Burgeromanii. Teraz bywamy tam regularnie.', 'Opinia 2', '', 'publish', 'closed', 'closed', '', 'opinia-2', '', '', '2020-01-29 18:08:44', '2020-01-29 17:08:44', '', 0, 'http://localhost/burgers_workon_project/?post_type=reviews&#038;p=146', 0, 'reviews', '', 0),
(147, 1, '2020-01-29 18:09:25', '2020-01-29 17:09:25', 'Dieta wege wymaga wymaga wyrzeczeń? Już nie. Kiedy mam ochotę na burgera, wchodzę na stronkę Burgeromanii, wybieram Burger Makera i dodaję do swojej kanapki dokładnie to, na co mam ochotę. Smacznie, szybko, ECO.', 'Opinia 3', '', 'publish', 'closed', 'closed', '', 'opinia-3', '', '', '2020-01-29 18:09:25', '2020-01-29 17:09:25', '', 0, 'http://localhost/burgers_workon_project/?post_type=reviews&#038;p=147', 0, 'reviews', '', 0),
